import React from 'react'
import './Navbar.css'

function Navbar  () {
  return (
    <ul className='navbar'>
      <li><a href="/" className="navbar-item">Monitoring</a></li>
      <a href="/product" className="navbar-item">Product</a>
      <a href="/user" className="navbar-item">User</a>
      <a href="/service" className="navbar-item">Service</a>

    </ul>
  )
}
export default Navbar;
